Lo potrà fare indipendentemente dal fatto che già ti abbia prestato soldi, o meno (anche solo per “organizzare” il proprio lavoro)👇
Se lo fa su di noi, quello che succederà è molto chiaro. https://t.co/7W47hXg3Bm

